import { ROUTE_CONSTANTS } from "../constants/route-constants";
import Task1 from "../Tasks_Components/Task1";
import Task2 from "../Tasks_Components/Task2";

export const config = [
  {
    id: "1",
    component: Task1,
    path: ROUTE_CONSTANTS.TASK_1,
  },
  {
    id: "2",
    component: Task2,
    path: ROUTE_CONSTANTS.TASK_1,
  },
];
